import React from 'react';

class ConvertDate extends React.Component {
  state = {
    d: "",
    day: "",
    month: "",
    date: "",
  };

  componentDidMount() {
    this.getDate();
  }

  getDate = () => {
    var d = new Date();
    let day = d.getDay();
    let month = d.getMonth();
    let date = d.getDate();
    this.setState({ d, day, month, date });
  };

  render() {
    const { date } = this.state;

    return <div>{date}</div>;
  }
}


export default ConvertDate;
